const App = () => {
  const course = "Half Stack Application Devlopment";
  const parts = [
    {
      name: "Fundamentals of React",
      exercises: 10,
    },
    {
      name: "Using Props to Pass Data",
      exercises: 7,
    },
    {
      name: "State of a Component",
      exercises: 14,
    },
  ];

  return (
    <div>
      <h1></h1>
      <h1>
        <Hello parts={parts} />
      </h1>
    </div>
  );
};

const Hello = (props) => {
  return (
    <div>
      <h1>woah!! {props.parts}</h1>
    </div>
  );
};

export default App;
